import React, { Fragment } from 'react';
import Button from '../components/Button'


const App = () => {
    return (
        <Fragment>
            <header>
                <img src="/images/GiftÜ.png" alt=""/>
            </header>
            <main>
                <section>
                    <h1>¿Que quieres regalar?</h1>
                </section>
                <section>
                    <Button text='Un regalo Recomendado'></Button>
                </section>
            </main>
        </Fragment>
    );
};

export default App;
